import React, {Component, useState, useEffect} from 'react'

function List(){

  const mylist = [
    {id: 1 , nome: 'Kaio Nunes', equipe: 'Wilson', mandinga: 'Cubo Magico', boa: false},
    {id: 1 , nome: 'Kaio Nunes', equipe: 'Wilson', mandinga: 'Cubo Magico', boa: false},
    {id: 1 , nome: 'Kaio Nunes', equipe: 'Wilson', mandinga: 'Cubo Magico', boa: false},
  ]


  return(
    <div>
      <ul>
      { mylist.map( lst => (
       <li>id: {lst.id} nome: {lst.nome}</li> 
      ))}
      </ul>
    </div>
  )
}


export default List
